import classes from './MealsSummary.module.css';

const MealsSummary = () => {
    return (
        <section className={classes.summary}>
     <h2> Feeling Hungry? Get It Delivered Right Away</h2>
     <p>
     Choose your favorite food from 3000+ restaurants and enjoy at your home.
     </p>
     <p>
     Craving for something delecious today? Get it delivered to your doorsteps or pick up whichever is convenient for you. As always there is no fee for pickup orders. Delivery within 40 minutes.
     </p>
     </section>
    );

};

export default MealsSummary;
